import React, { useEffect } from 'react'
import {connect} from 'react-redux'
import * as actions from '../actions/dCandidate'
import { Container, Grid,Paper, TableBody, TableCell, TableHead, TableRow } from '@material-ui/core'
import DCandidateForm from './DCandidateForm'


/*export default function DCandidates(props) {
  return (
    <div>from DCandidates</div>
  )
}*/

const DCandidates = (props) =>
  {
    useEffect(()=>
    {
      props.fetchAllDCandidates()
    }

    )
    return (
      <Paper>
        <Grid container>
            <Grid item xs={6}>
              <DCandidateForm></DCandidateForm>
            </Grid>
            <Grid item xs={6}>
              <Table>
                  <TableHead>
                      <TableRow>
                          <TableCell>Name</TableCell>
                          <TableCell>Mobile</TableCell>
                          <TableCell>Blood Group</TableCell>
                      </TableRow>
                  </TableHead>
                  <TableBody>
                      {
                        props.dCandidateList.map((records,index) => {
                          <TableRow>
                            <TableCell>{}</TableCell>
                          </TableRow>
                        })
                      }
                  </TableBody>
              </Table>
            </Grid>
        </Grid>
      </Paper>
    )
  }

const mapStateToProps = state => (
  {
    dCandidateList : state.dCandidate.List
  }  
)

const mapActionsToProps =   {
  fetchAllDCandidates : actions.fetchall
}

export default  connect(mapStateToProps,mapActionsToProps)(DCandidates)
